import React from "react";
import { Container, Row, Col } from "reactstrap";
import "./style.css";

const Contacts = () => {
  return (
    <section className="contacts">
      <Container>
        <h1>Contact me</h1>
        <h5>I am available for freelance projects and full-time employment.</h5>
      </Container>
    </section>
  );
};

export default Contacts;
